(223, 1, 'Audi', '<h3 style=\'text-align: center; \'>AUDI CAR COVERS</h3><div style=\'text-align: center;\'>Please select the model below to see which Audi tailored indoor and outdoor waterproof car covers are available.&nbsp;</div>', 'Waterproof Audi car covers in Uk | Best Audi A5 Covers | HD Car Covers', 'Protect your car from harsh weather conditions with the best outdoor Audi car covers in UK. We\'re covering all luxury car brands including Audi A5, A7, and many more.', 'Audi car cover, car cover for Audi a5, Audi car cover in UK'),
(273, 1, 'Alfa Romeo', '', 'Best Alfa Romeo Car covers in UK | Waterproof covers | HD Car Cover', 'HD car cover is the best alfa Romeo car cover supplier in UK.  We\'re selling genuine and waterproof car covers for every Alfa Romeo brand for just $139.', 'Best Alfa Romeo Car Cover,\r\nWaterproof Alfa Romeo covers'),
(276, 1, 'Aston Martin', '', 'Aston Martin Car Covers UK | Outdoor car covers | HD', 'HD car covers help save your vehicles with their best outdoor car covers. Our car covers protect your Aston martin from UV sunlight, rust, and rain. Buy Aston martin car covers for just $139.', 'Aston Martin Car Covers\r\nAston Martin Covers'),
(277, 1, 'Bmw', '', 'Waterproof BMW Car Covers UK | BMW 3 series | HD Car Covers', 'HD Car Covers is the best seller of waterproof BMW Car Covers in UK. Our BMW car covers collection has BMW 2 series, BMW 3 series, BMW 5 series, BMW 7 series and many others. Protect your BMW with HD car covers.', 'Waterproof BMW Car Covers UK, BMW Car Covers, BMW 3 series'),
(278, 1, 'Bentley', '', 'Best waterproof bentley car covers in UK | HD Car Covers', 'We provide the best waterproof Bentley car covers in UK. Our Car Covers are suitable for all luxury cars and prevent them from acid rain, wind storm, and disasters. Order your Bentley car cover and get up to 20% discount.', 'Bentley car covers, Bentley car covers UK, Waterproof Bentley car covers, bentley breathable car cover'),
(279, 1, 'Cadillac', '', 'Top Quality waterproof Cadillac car covers in UK  | HD Car Covers', 'Get your top quality waterproof Cadillac car covers in UK from the best waterproof car covers company.  Our premium quality car covers provide safety to your vehicle from dust and rain.', 'Top Quality waterproof Cadillac car covers,  Cadillac car covers, Cadillac car covers in UK'),
(280, 1, 'Chevrolet', '', 'Top Chevrolet Waterproof Car Covers in UK | chevrolet camaro car cover | HD', 'We are offering top quality Chevrolet Waterproof car covers in Uk. Protect your Chevrolet with our best waterproof car covers and enjoy your ride with confidence.', 'Top Chevrolet waterproof car covers, Chevrolet car covers'),
