(425, 1, 'Audi 80 - HD Outdoor Car Cover', 'HD Car Covers premium outdoor waterproof car cover is our top of the range car cover for your Audi 80. Our heavy duty car covers are perfectly fit for all variations of the Audi 80.\r\nIf youre looking for the best all weather car cover, our HD premium outdoor waterproof car cover is a reliable source for protection.\r\n\r\nAudi 80 Car Covers Description:\r\nOur HD Audi 80 waterproof outdoor car cover is made of high-quality polypropylene which offers outstanding resistance to the harsh elements, In addition to safeguarding a vehicle\'s interior and exterior, it also provides as a steal barrier by hiding your car from thieves.\r\n\r\nFeatures:\r\nGuaranteed perfect fit\r\n5 tie down buckle straps to keep it secure\r\nFully waterproof and breathable due to the heavy duty micro-porous oil based materials used\r\nThe fluffy inner fleece ensures the cover is gentle to your paint.\r\nBoth the front and rear hems are elasticated to allow for a snug fit.\r\n\r\nHD Car Covers protect your car from:\r\nBird Droppings\r\nDangerous UV Sunlight Rays\r\nAcid Rain\r\nHeavy Dust\r\nMildew Fungal\r\nTree Sap (Fluid)\r\nDirt\r\n\r\nHD Car Covers Premium Indoor car cover option\r\nThe indoor car cover option is similar to our Premium outdoor cover. It has all the features and characteristics of the premium outdoor cover however without the thick waterproof coated layer therefore not making it waterproof. The premium indoor cover is designed for vehicles which are to be stored indoors', '', 'Audi 80 Tailored outdoor car cover', 'Audi 80 guaranteed perfect fit waterproof outdoor car cover. 12 month warranty. Free next day delivery', 'Audi 80, waterproof outdoor car cover, premium car cover,'),
